package com.cdsxt.vo;

public class YongHu {
	private String fang;
	private String yonghu;
	public YongHu() {
		super();
		// TODO Auto-generated constructor stub
	}
	public YongHu(String fang, String yonghu) {
		super();
		this.fang = fang;
		this.yonghu = yonghu;
	}
	public String getFang() {
		return fang;
	}
	public void setFang(String fang) {
		this.fang = fang;
	}
	public String getYonghu() {
		return yonghu;
	}
	public void setYonghu(String yonghu) {
		this.yonghu = yonghu;
	}
}
